import React, { useEffect, useState } from "react";
// import { Table } from "react-bootstrap";
// import {  Table } from "semantic-ui-react";
import Table from "./BuyerWishlistTable";
import { useSelector, useDispatch } from "react-redux";
import axios from "axios";
// import wishlistData from "../../Data/CartDetails";

function Wishlist(props) {
  const [wishlistData, setWishlistData] = useState();

  const userDetails = useSelector((state) => state.userDetails);

  console.log(userDetails);
  useEffect(() => {
    axios
      .get("http://localhost:34365/api/Wishlists/" + userDetails.Id)
      .then((result) => {
        console.log(result);
        setWishlistData(result.data);
      });
  }, []);

  const tabRow = () => {
    return wishlistData.map(function (object, i) {
      return <Table obj={object} key={i} />;
    });
  };

  return (
    <div style={{ backgroundColor: "var(--c5l)" }}>
      <h4 style={{ backgroundColor: "var(--c2d)", color: "white" }}>
        Wishlist
      </h4>
      <table className="table table-bordered">
        <thead className="thead-dark">
          <tr>
            <th>pictures</th>
            <th>Product Name</th>
            <th>Product Brand</th>
            {/* <th>Product Type</th>
              <th>Origin</th>
              <th>Currency Price</th> */}
            <th>Price</th>
            {/* <th>Description</th> */}
            {/* <th>Shipping</th>
              <th>Quantity</th>
              <th>Shipping Option</th> */}
            <th>Remove</th>
          </tr>
        </thead>
        <tbody>{tabRow}</tbody>
      </table>
    </div>
  );
}

export default Wishlist;
